      <ParallaxText baseVelocity={2}>
        <span className="text-8xl">Zakaria Rab</span>
      </ParallaxText>
      <ParallaxText baseVelocity={-2}>
        <span className="text-8xl"> Rab Zakaria </span>
      </ParallaxText>
    </div>
  );
}

export default Intro;
